import React, { Component } from 'react';
import Card from './Card/Card';

class CardBody extends Component {
    render (){

    const diseño = 'Diseño';
    const entrega = 'Entrega';
    const disfruta = 'Disfruta';

    const uno = '1';
    const dos = '2';
    const tres = '3';

    const disCont = 'Tu diseñador personal te contactara para definir el estilo, preferencias y estilo.';
    const entCont = 'Te enviaremos un plan de entrega basado en tu diseño y frecuencia (semanal, quincenal, mensual).';
    const disfCont = 'Tu diseñador personal te contactara para definir el estilo, preferencias y estilo';

    const estilo = 'center bg-white br4  mv0 mh3 ba b--black-10 w-30-l w-100 vh-75';
    return (
        <div id='proceso' className='flex justify-center-ns flex-wrap w-75 center mv5 vh-100'>
            <Card text = {diseño} number = {uno} content = {disCont} estilo = {estilo} /> 
            <Card text = {entrega}  number = {dos} content = {entCont} estilo = {estilo}/>
            <Card text = {disfruta}  number = {tres} content = {disfCont} estilo = {estilo}/>
        </div>

    );

    }
    }

    export default CardBody;
